import { NavVertical } from "../../components/Nav";

export const ConceptsPage = () => {
    return (
        <StrictMode>
            <section>
                <nav className="nav-vertical">
                    <NavVertical />
                </nav>
            </section>
        </StrictMode>
    );
};
